import React from "react";
import './Hero.css';
import hoodie from '../Assets/hoodie.jpeg';

const Hero = () => {
    return (
        <div className='hero'>
            <div className='hero-content'>
                <h1 className='hero-title'>Be Your Own Brand</h1>
                <p className='hero-tagline'>Discover our latest designs make a statement with your style.</p>
                <div className="hero-boxes">
                    <div className="hero-box">
                        <img src="/src/Components/Assets/hoodie.jpeg" alt="Collection One" />

                    </div>
                    <div className="hero-box">
                        <img src="/path-to-image2.jpg" alt="Collection Two" />
                        <button className='hero-button'>Shop Now</button>
                    </div>
                    <div className="hero-box">
                        <img src="/src/Components/Assets/graduationSash.webp" alt="Collection Three" />
                        <button className='hero-button'>Shop Now</button>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Hero;
